import React from 'react'

export default function Login() {


    const fetchapi_fun=()=>{
        fetch(' https://fbapi.sellernext.com/user/login')

    }
  return (
    <div>
        <div>
            <p><input type="text"/></p>
            <p><input type="password"/></p>
            <p><input type="submit" onClick={()=>fetchapi_fun}/></p>

        </div>
    </div>
  )
}
